import * as c from '../styles/categoryDetailStyle';

const CategoryDetailView = () => {
  return (
    <c.CategoryDetailContainer>
      <c.CategoryDetailImageContainer>
        <c.CategoryDetailImage src="" />
      </c.CategoryDetailImageContainer>
      <c.CategeoryDetailInfoContainer>
        <c.CategoryStoreName>S아쿠아</c.CategoryStoreName>
        <c.CategoryDetailInfoTitle>구피 50마리 팝니다.</c.CategoryDetailInfoTitle>
        <c.CategoryDetailCategory>어류</c.CategoryDetailCategory>
        <c.CategoryDetailOriginPrice>30,000원</c.CategoryDetailOriginPrice>
        <c.CategoryDetailDiscountPriceContainer>
          <c.CategoryDetailDiscountRate>30%</c.CategoryDetailDiscountRate>
          <c.CategoryDetailSalePrice>21,000원</c.CategoryDetailSalePrice>
        </c.CategoryDetailDiscountPriceContainer>
      </c.CategeoryDetailInfoContainer>
    </c.CategoryDetailContainer>
  );
};

export default CategoryDetailView;
